import React from 'react';

const ParkingInfo = ({ parkingInfo, onReserve }) => {
  const { totalSlots, availableSlots } = parkingInfo;
  
  return (
    <div className="card">
      <h3>Parking Status</h3>
      <div style={{ padding: '15px' }}>
        <div className="d-flex justify-content-between align-items-center">
          <div>
            <div className="d-flex align-items-center mb-2">
              <div style={{ width: '12px', height: '12px', backgroundColor: '#e8f5e9', border: '1px solid #1b5e20', marginRight: '8px' }}></div>
              <span>Available: <strong>{availableSlots}</strong></span>
            </div>
            <div className="d-flex align-items-center">
              <div style={{ width: '12px', height: '12px', backgroundColor: '#ffebee', border: '1px solid #b71c1c', marginRight: '8px' }}></div>
              <span>Occupied: <strong>{totalSlots - availableSlots}</strong></span>
            </div>
          </div>
          <button 
            onClick={onReserve} 
            className="btn btn-primary"
            disabled={availableSlots === 0}
          >
            {availableSlots === 0 ? 'No Slots Available' : 'Reserve Slot'}
          </button>
        </div>
      </div>
    </div>
  );
};

export default ParkingInfo;
